export const v4GHy = pgView("4g_hy", {
  beginTime: timestamp("Begin Time", { precision: 6, mode: "string" }),
  cellName: varchar("Cell Name", { length: 200 }),
  cellId: doublePrecision(),
  sector: text("Sector"),
  siteid: text(),
  payload: doublePrecision("Payload"),
  "4GAvail": doublePrecision("4g_avail"),
  rrcsetupsr: doublePrecision(),
  userdlthp: doublePrecision(),
  dlprbutil: doublePrecision(),
  user: doublePrecision(),
  cqi: doublePrecision(),
  se: doublePrecision(),
  averageNicarrier: doublePrecision(),
  ulprbutil: doublePrecision(),
  erabsr: doublePrecision(),
  erabdrop: doublePrecision(),
  ifhosr: doublePrecision(),
  cssr: doublePrecision(),
  interfreqsr: doublePrecision(),
}).as(
  sql`SELECT "Begin Time", "Cell Name", "cellId", CASE WHEN "cellId" = ANY (ARRAY[101::double precision, 102::double precision, 103::double precision, 104::double precision, 105::double precision, 111::double precision, 114::double precision, 121::double precision, 123::double precision, 124::double precision, 131::double precision, 132::double precision, 133::double precision, 134::double precision, 141::double precision, 142::double precision, 143::double precision, 144::double precision, 145::double precision, 151::double precision, 152::double precision, 153::double precision, 154::double precision, 155::double precision, 161::double precision, 162::double precision, 163::double precision, 164::double precision, 165::double precision, 171::double precision, 172::double precision, 173::double precision, 181::double precision, 182::double precision, 183::double precision, 191::double precision, 192::double precision, 193::double precision, 201::double precision, 203::double precision]) THEN "left"("cellId"::text, 2) ELSE CASE SUBSTRING("cellId"::text FROM length("cellId"::text) - 1 FOR 1) WHEN '4'::text THEN '1'::text WHEN '5'::text THEN '2'::text WHEN '6'::text THEN '3'::text ELSE SUBSTRING("cellId"::text FROM length("cellId"::text) - 1 FOR 1) END END AS "Sector", CASE WHEN (regexp_match("Cell Name"::text, '[A-Z]{3}[0-9]{3}'::text))[1] ~~ 'EPS%'::text THEN (regexp_match("Cell Name"::text, '.*_([A-Z]{3}[0-9]{3})_'::text))[1] ELSE (regexp_match("Cell Name"::text, '[A-Z]{3}[0-9]{3}'::text))[1] END AS siteid, "4G Payload (MByte) AMQ" / 1024::double precision AS "Payload", "Cell Availability Num 4G AMQ" / NULLIF("Cell Availability Denum 4G AMQ", 0::double precision) * 100::double precision AS "4g_avail", "Num RRC Setup SR AMQ" / NULLIF("Denum RRC Setup SR AMQ", 0::double precision) * 100::double precision AS rrcsetupsr, "User DL Throughput Num AMQ" / NULLIF("User DL Throughput Denum AMQ", 0::double precision) / 1024::double precision AS userdlthp, "DL PRB Utilization Num AMQ" / NULLIF("DL PRB Utilization Denum AMQ", 0::double precision) * 100::double precision AS dlprbutil, "Maximum Number of RRC Connection User" AS "user", "CQI Average AMQ" AS cqi, "spectrum efficiency" AS se, "Average NI of Carrier(dBm)" AS "averageNIcarrier", "UL PRB Utilization Num AMQ" / NULLIF("UL PRB Utilization Denum AMQ", 0::double precision) * 100::double precision AS ulprbutil, "Num E-RAB Setup SR AMQ" / NULLIF("Denum E-RAB Setup SR AMQ", 0::double precision) * 100::double precision AS erabsr, "Num E-RAB Drop AMQ" / NULLIF("Denum E-RAB Drop AMQ", 0::double precision) * 100::double precision AS erabdrop, "Num IFHO SR AMQ" / NULLIF("Denum IFHO SR AMQ", 0::double precision) * 100::double precision AS ifhosr, "Num CSSR AMQ" / NULLIF("Denum CSSR AMQ", 0::double precision) * 100::double precision AS cssr, "Inter Freq LTE HO Num AMQ" / NULLIF("Inter Freq LTE HO Denum AMQ", 0::double precision) * 100::double precision AS interfreqsr FROM "measHy4g"`,
);

